Overview:
Few movies capture the triumph of the human spirit as memorably as The Shawshank Redemption. Morgan Freeman and Tim Robbins star in this powerful nominee for seven Academy Awards (including Best Picture) based on a Stephen King story.

Freeman play "Red" Redding , a lifer who knows the ropes at Maine's Shawshank State Prison.  Robbins is new inmate Andy Dufresne, a quiet banker unjustly convicted of murder.  Andy's indomitabe will earns Red's friendship;
his resourcfulness brings hope and change to the entire prison.  Andy is full of surprises - and he saves his best for last.  Written and directed by Frank Darabont (The Green Mile), The Shawshank Redemption is "an engrossing, superbly acted yarn" (Tom Charity, Time Out Film Guide).
